import { FC, Fragment, HTMLAttributes, useState } from "react";
import BlockTitle from "../../BlockTitle";
import Button from "../../Button";
import Carousel, { Props as CarouselProps } from "../../Carousel";
import Grid from "../../Grid";
import Chevron from "../../Icons/Chevron";

const ComposedEditions: FC<HTMLAttributes<HTMLDivElement>> = (props) => {
  const items = [
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
  ];
  const [index, setIndex] = useState(0);
  const visibleItems = 3;

  const changeIndex: CarouselProps["onIndexChange"] = (offset) => {
    const newIndex = index + offset;

    setIndex(
      newIndex < 0 ? 0 : Math.min(items.length - visibleItems, newIndex)
    );
  };
  const onPrev = () => changeIndex(-1);
  const onNext = () => changeIndex(1);

  return (
    <Grid {...props}>
      <BlockTitle
        variant="h3"
        title="All Editions"
        action={
          <Fragment>
            <Button
              disabled={index === 0}
              onClick={onPrev}
              variant="bordered"
              Icon={Chevron}
              size="small"
              iconProps={{
                css: (theme) => ({
                  width: theme.spacing(0.8),
                  height: theme.spacing(1.6),
                  transform: "rotate(-180deg)",
                }),
              }}
            />
            <Button
              disabled={
                items.length <= visibleItems ||
                index === items.length - visibleItems
              }
              onClick={onNext}
              variant="bordered"
              css={(theme) => ({ marginLeft: theme.spacing(2) })}
              Icon={Chevron}
              size="small"
              iconProps={{
                css: (theme) => ({
                  width: theme.spacing(0.8),
                  height: theme.spacing(1.6),
                }),
              }}
            />
          </Fragment>
        }
        css={{ gridColumn: "2 / span 10" }}
      />
      <Carousel
        css={(theme) => ({ gridColumn: "1 / -1", marginTop: theme.spacing(4) })}
        items={items}
        index={index}
        onIndexChange={changeIndex}
      />
    </Grid>
  );
};

export default ComposedEditions;
